var b="url",c="创建计划工单_加字段）.html",d="generationDate",e=new Date(1629706743091.99),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="time",s="captcha",t="qidongye",u="page",v="packageId",w="bdc1a5aaa65743a5b5f8de04e94afc89",x="type",y="Axure:Page",z="创建计划工单(加字段）",A="notes",B="annotations",C="fn",D="1",E="ownerId",F="88c107331b394cb18ca086562ca2381a",G="label",H="产出物料：",I="说明",J="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">产出物料要和下面销售订单的物料行对应</span></p>",K="前端",L="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">单选，下拉框</span></p>",M="交互解释",N="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">若用户第一步没有选择产出物料，则在销售订单中选择物料后，产出物料的框体内自动填充该 物料编号/物料名称</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">若用户先选择了产出物料，则下方销售订单物料行都需要筛选</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">选择销售订单</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">后，如果该订单有物料项，则</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;color:#333333;\">销售订单物料行</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;color:#333333;\">可以选择该物料，否则这个框不可选择</span></p>",O="2",P="e72aaa04f0494617a8afe4463f7672c3",Q="销售订单编号/名称",R="3",S="e7aae4499d4f42d0945480bede33c838",T="销售订单物料行",U="4",V="ad5218effaf04083bbdaad6c15540f44",W="物料交货日期",X="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">根据销售订单信息自动带出</span></p>",Y="5",Z="5cd6da92979d42889ae5b302644fc248",ba="L",bb="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">自动填充物料的主单位</span></p>",bc="6",bd="c4e93130d0e34ddcb03e36408fec2265",be="14",bf="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">需要验证</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">格式为正数</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">自动根据上方的销售订单算出一个交货</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">数量</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">该文本框依然可以编辑</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">填写的数量可以大于下方的库存</span></p>",bg="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">空格、文本、负数等都需要验证，不正确需要提示信息</span></p>",bh="7",bi="4db4cb85a223412593765b08a81db3da",bj="数量：",bk="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">产出物料的原料数量</span></p>",bl="8",bm="68e8faad71704b9681f26ca24567f203",bn="请选择",bo="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">单选、下拉框、</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">选项为批号规则名称</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">列表</span></p>",bp="9",bq="6922c228d0314c258b246907f1809ea3",br="(图片)",bs="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">计数器、&gt;=0</span></p>",bt="10",bu="da299ff73ef54bed969907e03d72a086",bv="计划工单类型：",bw="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">选择面向销售订单，下方销售订单显示并填写</span></p><p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">选择面向库存，下方销售订单项不展示</span></p>",bx="11",by="731780ea529e45be933e4397f2c32003",bz="用户",bA="<p><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">单选</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">，下拉框</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">，选项</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">：</span><span style=\"font-family:'Arial Normal', 'Arial';text-decoration:none;\">用户/用户组</span></p>",bB="12",bC="1db5f6fc8d35414dbe54cd6fe25fd7c1",bD="请选择计划员",bE